const TimeTest = () => {
  function happy(sec, second) {
    for (let i = 0; i <= sec; i++) {
      setTimeout(() => {
        console.log(i);
      }, second * i);
    }
  }
  happy(3, 1000);

  return <>
  <div></div>
  </>;
};
export default TimeTest();
